window.bookSummaryJSON = "<p><b>Machine Learning with TensorFlow</b>&nbsp;</p> <p>TensorFlow is a powerful open source software library for performing various numerical data flow graphs. With its powerful resources, TensorFlow is perfect for machine learning enthusiasts, offering plenty of workspace where you can improve your machine learning techniques and build your own machine learning algorithms.&nbsp;</p> <p>Thanks to its capability, in recent times TensorFlow definitely has made its way into the software mainstream, so everyone who is interested in machine learning definitely should consider getting their hands on TensorFlow practices.&nbsp;</p> <p>With this book as your guide, you will get your hands on TensorFlow machine learning techniques, learn how to perform different neural network operations, learn how to deal with massive data sets, and learn how to build your first machine learning model for data classification.</p> <p>Here's a preview of what you'll learn:</p> <p></p> <ul> <li>What is machine learning</li> <li>Main uses and benefits of machine learning</li> <li>How to get started with TensorFlow, installing and loading data&nbsp;</li> <li>Data flow graphs and basic TensorFlow expressions&nbsp;</li> <li>How to define your data flow graphs and how to use TensorBoard for data visualization&nbsp;</li> <li>Main TensorFlow operations and building tensors</li> <li>How to perform data transformation using different techniques</li> <li>How to build high performance data pipelines using TensorFlow Dataset framework</li> <li>How to create TensorFlow iterators&nbsp;</li> <li>Creating MNIST classifiers with one-hot transformation</li> </ul> <p><i>Get this audiobook now and learn how to do various machine learning tasks using TensorFlow!</i></p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying PDF will be available in your Audible Library along with the audio.</b></p>"; 
